class Solution:    def maxProfit(self, prices, fee):        """        :type prices: List[int]        :type fee: int        :rtype: int        """        n=len(prices)        sell,buy=[0 for i in range(n)],[0 for i in range(n)]        sell[0],buy[0]=0,-prices[0]        for i in range(1,n,1):            sell[i]=max(sell[i-1],prices[i]+buy[i-1]-fee)            buy[i]=max(buy[i-1],sell[i-1]-prices[i])        return sell[n-1]